import PropTypes from 'prop-types';
import classNames from 'classnames';

class Gallery extends React.Component {
  render() {
    return (
      <section className='gallery'>
        <div className='gallery-grid'>
          <div className='grid-img-1'><img src='/static/bg_gallery_1.png' alt='' /></div>
          <div className='grid-img-2'><img src='/static/bg_gallery_5.png' alt='' /></div>
          <div className='grid-img-3'><img src='/static/bg_gallery_5.png' alt='' /></div>
          <div className='grid-img-4'><img src='/static/bg_gallery_5.png' alt='' /></div>
          <div className='grid-img-5'><img src='/static/bg_gallery_5.png' alt='' /></div>
        </div>
        <style jsx>{`
          .gallery {
            grid-area: gallery;
          }
          .gallery-grid {
            display: grid;
            grid-gap: 20px;
            grid-template-columns: [C1]1fr [C2]1fr [C3]1fr [C4]1fr [C5];
            grid-template-rows: [R1]1fr [R2]1fr [R3]1fr [R4];
          }
          .grid-img-1 {
            grid-column: C1/C3;
            grid-row: R1/R3;
            height: 100%;
            width: auto;
          }
          img {
            width: 100%;
          }
        `}</style>
      </section>
    )
  }

}

export default Gallery
